import React,{useContext} from 'react'
import { contextData } from './Context'
import { NavLink,Link } from 'react-router-dom'
// import { Home } from './Home';
import "./blogStyles.css"; //ths is serious


export const Header = () => {
    const [article]=useContext(contextData);
    const st={
        textDecoration:"none",color:'black'
    }
    const color=(active)=>{
        return {"color":active?"gray":""}
    }
    return (
        <div className='stkhead'>
            <h1 className='headsiren'><h2>The</h2>Siren</h1>
            <h2 className='titlelink'>
            <NavLink style={(color(active))} to='./home' style={st}> Home</NavLink>
            <Link to='./bollywood' style={st}> Bollywood</Link>
            <Link to='./technology' style={st}> Technology</Link>
            <Link to='./hollywood' style={st}> Hollywood</Link>
            <Link to='./fitness' style={st}> Fitness</Link>
            <Link to='./food' style={st}> Food</Link>
            </h2><hr style={{margin:"0px 150px"}}/>

        </div>
    )
}
